import React from 'react';

function App() {
  return ( 
    <ul>
      <li>Sum of the numbers is {add(40, 4)}</li>
      <li>Diff of the numbers is {sub(40, 4)}</li>
      <li>Div of the numbers is {div(40, 4)}</li>
      <li>Mult of the numbers is {mult(40, 4)}</li>
    </ul>
   );
}

export default App;
